import { html, css, nothing, repeat } from '/vendor/@lit/all@3.1.2/lit-all.min.js';

var pupCardGrid = css`
  .pup-card-grid {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(400px, 1fr));
  }
`

export function renderSectionHeader(ready) {

  return html`
    <div class="actions">
      <sl-dropdown>
        <sl-button slot="trigger" ?disabled=${this.busy}><sl-icon name="three-dots-vertical"></sl-icon></sl-button>
        <sl-menu @sl-select=${this.handleActionsMenuSelect}>
          <sl-menu-item>
            Repository
            <sl-menu slot="submenu">
              <sl-menu-item value="repository-local">Local</sl-menu-item>
              <sl-menu-item value="repository-remote-a">Remote A</sl-menu-item>
              <sl-menu-item value="repository-remote-b">Remote B</sl-menu-item>
              <sl-menu-item value="repository-remote-c">Remote C</sl-menu-item>
            </sl-menu>
          </sl-menu-item>
          <sl-menu-item value="refresh">Refresh</sl-menu-item>
        </sl-menu>
      </sl-dropdown>
    </div>
  `
}

export function renderSectionBody(ready, SKELS, hasItems) {
  return html`
    ${this.fetchLoading ? html`
      <div class="details-group">
        ${repeat(SKELS, (_, index) => index, () => html`
          <pup-snapshot-skeleton></pup-snapshot-skeleton>
        `)}
      </div>
    ` : nothing }

    ${ready && !hasItems('packages') ? html`
      <div class="empty">
        Such empty.<br>
        No pups available in this repository.
      </div>
      ` : nothing 
    }

    ${ready && hasItems('packages') ? html`
      <div class="pup-card-grid">
        ${repeat(this.packageList.getCurrentPageData(), (pkg) => `${pkg.def.source.id}-${pkg.def.key}`, (pkg) => {
          const others = [
            { name: "Block Explorer", short: "Browse the Dogecoin blockchain", base64: " data:image/png;base64," },
            { name: "Shibe Shop", short: "Host a decentralised online store", base64: "  data:image/png;base64," },
            { name: "Paw Print", short: "Meme t-shirt print service", base64: "  data:image/png;base64," },
            { name: "Tipjar", short: "Send and receive tips", base64: " data:image/png;base64," },
            { name: "DogeDocs", short: "Document notarization on Dogecoin blockchain", base64: " data:image/png;base64," },
            { name: "Bark Box", short: "Decentralized storage secured by Dogecoin blockchain", base64: "  data:image/png;base64," },
            { name: "Pup School", short: "E-learning platform with Dogecoin rewards", base64: " data:image/png;base64," },
            { name: "DogeQR", short: "QR code generator for Dogecoin addresses", base64: "   data:image/png;base64," },
            { name: "ShibeArt", short: "Art school for Shibe's", base64: "  data:image/png;base64," },
            { name: "Wag", short: "Habit tracker app with Dogecoin incentives", base64: " data:image/png;base64," },
          ]
          return html`
          <pup-install-card
            defaultIcon="box"
            sourceId=${pkg.def.source.id}
            defKey=${pkg.def.key}
            pupName=${pkg.def.key}
            version=${pkg.def.latestVersion}
            logoBase64=${pkg.def.logoBase64}
            .upstreamVersions=${pkg.def.versions[pkg.def.latestVersion]?.meta?.upstreamVersions || {}}
            short="${pkg.def.versions[pkg.def.latestVersion]?.meta?.shortDescription}"
            ?installed=${pkg.computed.isInstalled}
            href=${pkg.computed.storeURL}
          ></pup-install-card>
          ${repeat(others, (other) => other.name, (other) => {
            return html`
              <pup-install-card
                defaultIcon="box"
                sourceId=${pkg.def.source.id}
                defKey=${pkg.def.key}
                pupName=${other.name}
                version=${pkg.def.latestVersion}
                logoBase64=${other.base64}
                short="${other.short}"
                ?installed=${pkg.computed.isInstalled}
                href=${pkg.computed.storeURL}
              ></pup-install-card>
            `
          })}

        `})}
      </div>
      <style>${pupCardGrid}</style>

      <paginator-ui
        ?disabled=${this.busy}
        @go-next=${this.packageList.nextPage}
        @go-prev=${this.packageList.previousPage}
        currentPage=${this.packageList.currentPage}
        totalPages=${this.packageList.getTotalPages()}
      ></paginator-ui>

      `: nothing
    }
  `
}